class Solution {
    func numberOfGoodPartitions(_ nums: [Int]) -> Int {
        let mod = 1_000_000_007
        var lastPosition = [Int: Int]()
        var dp = [Int](repeating: 0, count: nums.count + 1)
        dp[0] = 1

        for i in 1...nums.count {
            dp[i] = dp[i - 1]
            if let last = lastPosition[nums[i - 1]] {
                dp[i] = (dp[i] - dp[last] + mod) % mod
            }
            lastPosition[nums[i - 1]] = i - 1
        }

        var result = 1
        for i in 1...nums.count {
            if lastPosition[nums[i - 1]] == i - 1 {
                result = (result * 2) % mod
            }
        }

        return result
    }
}
